question:
두 함수 $f(x)$와 $g(x)$의 그래프가 아래와 같이 정의됩니다. 여기서 정의역은 $0\le x\le 18$입니다:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-1.5,xmax=18.5,ymin=-1.5,ymax=12.5;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=2.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=2.0,Size=2,NoZero),Arrows(6),above=true);
draw((0,10)--(2,10)--(8,4)--(10,4)--(18,12),darkgreen+1.5);
draw((0,2)--(6,8)--(10,8)--(12,10)--(18,10),orange+dashed+1.5);
[/asy]

$f(x)$의 그래프가 주황색 점선이고, $g(x)$의 그래프가 초록색 실선일 때, $f(x)-g(x)$의 최대값은 얼마입니까?

아래는 함수 $y=h(x)$의 그래프 일부입니다:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.75,xmax=8.25,ymin=-1.25,ymax=10.25;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return (x-0.5)*(x-2.5)*(x-6.5)*(x-7.5)/16+x;}
draw(graph(f1,-0.25,8.25),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=h(x)$",(8.5,8),E);
[/asy]

$h(x)>x$인 구간에 표시된 ($0\le x\le 8$) 모든 정수 $x$의 합은 얼마입니까?

두 원이 각각 중심이 $(-3,2)$와 $(0,-1)$에 있으며, 내부 접하고 있습니다. 작은 원의 방정식이 $x^2 + y^2 + Dx + Ey + F = 0$ 형태로 작성될 수 있다면, $D + E + F$ 값을 구하세요. [asy]
import graph; size(7cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-9.34,xmax=9.27,ymin=-9.36,ymax=7.89;

Label laxis; laxis.p=fontsize(10);

xaxis(xmin,xmax,Ticks(laxis,Step=2.0,Size=2,OmitTick(0)),Arrows(6),above=true); yaxis(ymin,ymax,Ticks(laxis,Step=2.0,Size=2,OmitTick(0)),Arrows(6),above=true); draw(circle((0,-1),7.07)); draw(circle((-3,2),2.83));

dot((0,-1),ds); label("$(0, -1)$",(0.23,-1.87),SE*lsf); dot((-3,2),ds); label("$(-3, 2)$",(-2.82,2.29),N*lsf); dot((1,6),ds); label("$(1, 6)$",(1.2,6.3),NE*lsf); dot((-5,4),ds);

clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy] 작은 원의 방정식이 $x^2 + y^2 + Dx + Ey + F = 0$ 형태로 작성될 수 있다면, $D + E + F$ 값을 구하세요.

함수 \( f(x) \)의 그래프가 아래에 그려져 있습니다. 각 작은 상자의 너비와 높이는 1입니다.

[asy]
size(150);
import TrigMacros;
rr_cartesian_axes(-1,10,-1,10);

dot((1,7),red+5bp);
dot((2,4),red+5bp);
dot((3,1),red+5bp);
dot((4,8),red+5bp);
dot((5,5),red+5bp);
dot((6,2),red+5bp);
dot((7,9),red+5bp);
dot((8,6),red+5bp);
dot((9,3),red+5bp);
[/asy>
\( f(f(1)) + f(f(2)) + f(f(3)) + \cdots + f(f(8)) + f(f(9)) \)의 값은 얼마인가요?

Let \[f(x) =
\begin{cases}
x^2+9 &\text{if }x<-5, \\
3x-8&\text{if }x\ge-5.
\end{cases}
\]일 때, $f(x)=10$이 되는 모든 가능한 $x$ 값의 합을 구하시오.

\[ f(x) =
\begin{cases}
-\sqrt[3]x & \text{if } x \geq 0,\\
x^2 & \text{if } x < 0.
\end{cases}
\]을 이용해 $f(f(f(f(512))))$의 값을 구하라.

$x$와 $y$가 다음의 식을 만족하는 실수라고 가정하자.
\begin{align*}
4y - 4x^2 &= 1 \\
4x - 4y^2 &= 1.
\end{align*}
$\dfrac{1}{x^3 + y^3}$의 값은 얼마인가?

Let \[f(n) = \left\{
\begin{array}{cl}
n^3+2n-1 &\text{ if }n>1, \\
n-1 &\text{ if }n \le 1.
\end{array}
\right.\] $f(0)+f(1)+f(2)$의 값을 구하시오.

어떤 상수 $a$와 $b$에 대해 함수 $f(x)$는 다음과 같이 정의됩니다: \[f(x) = \left\{
\begin{array}{cl}
9 - 2x & \text{if } x \le 3, \\
ax + b & \text{if } x > 3.
\end{array}
\right.\] 함수 $f$는 모든 $x$에 대해 $f(f(x)) = x$를 만족합니다. $a + b$는 얼마입니까?

그래프에서 각 그리드 선은 한 단위로 계산됩니다. 아래에 표시된 선은 점 $(1001,n)$을 통과합니다(그래프에는 표시되지 않음). $n$을 구하세요.
[asy]size(250,0);
add(shift(-10,-10)*grid(20,20));
draw((-10,0)--(10,0),linewidth(2));
draw((0,-10)--(0,10),linewidth(2));
label("x",(10,0),E);
label("y",(0,10),N);
draw((-10,-2.71) -- (10,8.71),blue,Arrows);[/asy]

정수 $n$에 대해 함수 $f(n)$을 다음과 같이 정의했을 때, \[f(n) = \left\{
\begin{array}{cl}
n^2 + 1 & \text{ if }n\text{이 홀수인 경우}, \\
n^2 - 3n + 1 & \text{ if }n\text{이 짝수인 경우}.
\end{array}
\right.\]
$f(f(f(f(f(f(2))))))$을 구하세요.

 $a$와 $b$가 양의 실수라고 가정하고, \[f(x) =
\begin{cases}
\frac{a}{b}x & \text{  }x\le-4, \\
abx^2 & \text{  }x>-4.
\end{cases}
\]일 때, $f(-4)=-\frac{60}{13}$이고 $f(4)=3120$이면, $a+b$는 얼마인가요?

$x+y\neq -1$일 때, 다음 식을 만족하는 $a+b+c$의 값을 구하시오: 
\begin{align*} 
ax+by+c&=x+7,\\ 
a+bx+cy&=2x+6y,\\ 
ay+b+cx&=4x+y. 
\end{align*}

$y=f(x)$의 완전한 그래프는 빨간색으로 아래에 표시된 다섯 개의 선분으로 구성되어 있습니다. (이 그래프에서 격자선 사이의 거리는 $1$입니다.) $g(x)=f(x)+ax$ 및 $h(x)=f(x)+bx$ 함수가 가역적이도록 하는 가장 큰 음의 정수 $a$와 가장 작은 양의 정수 $b$가 각각 있습니다. $a^2+b^2$는 얼마입니까?

[asy]
size(150);
real ticklen=3;
real tickspace=2;

real ticklength=0.1cm;
real axisarrowsize=0.14cm;
pen axispen=black+1.3bp;
real vectorarrowsize=0.2cm;
real tickdown=-0.5;
real tickdownlength=-0.15inch;
real tickdownbase=0.3;
real wholetickdown=tickdown;
void rr_cartesian_axes(real xleft, real xright, real ybottom, real ytop, real xstep=1, real ystep=1, bool useticks=false, bool complexplane=false, bool usegrid=true) {

import graph;

real i;

if(complexplane) {

label("$\textnormal{Re}$",(xright,0),SE);

label("$\textnormal{Im}$",(0,ytop),NW);

} else {

label("$x$",(xright+0.4,-0.5));

label("$y$",(-0.5,ytop+0.2));

}

ylimits(ybottom,ytop);

xlimits( xleft, xright);

real[] TicksArrx,TicksArry;

for(i=xleft+xstep; i<xright; i+=xstep) {

if(abs(i) >0.1) {

TicksArrx.push(i);

}

}

for(i=ybottom+ystep; i<ytop; i+=ystep) {

if(abs(i) >0.1) {

TicksArry.push(i);

}

}

if(usegrid) {

xaxis(BottomTop(extend=false), Ticks("%", TicksArrx ,pTick=gray(0.22),extend=true),p=invisible);//,above=true);

yaxis(LeftRight(extend=false),Ticks("%", TicksArry ,pTick=gray(0.22),extend=true), p=invisible);//,Arrows);

}

if(useticks) {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, Ticks("%",TicksArry , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, Ticks("%",TicksArrx , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

} else {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, above=true, Arrows(size=axisarrowsize));

}
};
rr_cartesian_axes(-5,5,-5,5);
draw((-5,-4)--(-2,5)--(-1,3)--(1,-5)--(3,2)--(5,2),red+1);
dot((-5,-4),red);
dot((-2,5),red);
dot((-1,3),red);
dot((1,-5),red);
dot((3,2),red);
dot((5,2),red);
[/asy]

함수 $f$가 다음과 같이 정의되어 있을 때 \[f(x) = \left\{
\begin{array}{cl}
3-x & \text{if } x \leq 3, \\
-x^3+2x^2+3x & \text{if } x > 3.
\end{array}
\right.\] $f^{-1}(0)+f^{-1}(6)$를 구하세요.

아래의 방정식 $y=ax^2+bx+c$인 포물선이 그래프로 그려져 있습니다:

[asy]
unitsize(0.2 cm);
xaxis(-5,9);

yaxis(-7,2);

real g(real x)

{

return -1/9*(x-2)^2+1;
}

draw(graph(g,-5,9));
dot((2,1));
label("Vertex: $(2,1)$", (2,1), NE);
dot((-4,-3));
label("$(-4,-3)$", (-4,-3), W);
[/asy]

이차식 $ax^2 + bx + c$의 근은 $x=m$과 $x=n$에 있으며, 여기서 $m>n$입니다. $m-n$은 얼마입니까?

정수 2부터 9까지 각각의 정수가 각 8개의 작은 삼각형에 하나씩 배치됩니다. 정수들이 각 4개의 작은 사각형에 있는 정수의 쌍들이 동일한 합을 가지도록 배치할 때, 그 합은 무엇입니까?

[asy]
size(101);
draw(unitsquare);
draw(shift(up)*shift(right)*unitsquare);
filldraw(shift(up)*unitsquare,gray(.6));
filldraw(shift(right)*unitsquare,gray(.6));
draw((0,0)--(2,2)^^(0,2)--(2,0));
[/asy]

이 그래프는 Caroline의 산책에서 초 단위 시간 $x$와 Caroline이 출발점에서 떨어진 거리 $y$의 선형 관계를 보여줍니다. 그래프는 점 $(20,30)$을 지납니다. 그래프에 따르면, Caroline은 정확히 한 시간에 몇 미터를 걸을까요? [asy]

pair A,B,C,D,E,F,G;

A=(-20,0);
B=(120,0);
C=(0,-20);
D=(0,120);
E=(-6.2,-8);
F=(60,90);
G=(70,105);

dot(F);

draw(A--B,Arrows);
draw(C--D,Arrows);
draw(E--G,Arrows);

label("(20,30)",G,SE);
label("$y=1.5x$",G,N);
[/asy]

다섯 면의 별에서, 문자 $A$, $B$, $C$, $D$, $E$는 순서와 상관없이 숫자 3, 5, 6, 7, 9로 대체됩니다. 선분 $\overline{AB}$, $\overline{BC}$, $\overline{CD}$, $\overline{DE}$, $\overline{EA}$의 끝에 있는 숫자들의 합은 순서와 상관없이 등차수열을 형성합니다. 등차수열의 가운데 항은 무엇입니까?

[asy]
pair A,B,C,D,E;
A=(0,10);
B=(5.9,-8.1);
C=(-9.5,3.1);
D=(9.5,3.1);
E=(-5.9,-8.1);
draw(A--B--C--D--E--cycle,linewidth(0.7));
label("$A$",A,N);
label("$B$",B,SE);
label("$C$",C,NW);
label("$D$",D,NE);
label("$E$",E,SW);
[/asy]

$y=ax^2+bx+c$의 그래프가 아래에 주어져 있으며, 여기서 $a$, $b$, $c$는 정수입니다. $a+b+c$를 구하세요.

[asy]
Label f;

f.p=fontsize(4);

xaxis(-3,3,Ticks(f, 1.0));

yaxis(-4,4,Ticks(f, 1.0));

real f(real x)

{

return -2x^2+4x+1;

}

draw(graph(f,-.7,2.7),linewidth(1),Arrows(6));
[/asy]

주어진 원들은 무한히 계속되며 직경이 16인치, 8인치, 4인치, 그리고 계속됩니다. 각 원의 직경은 이전 원의 직경의 절반입니다. 모든 원들의 넓이를 더한 값의 제곱인치는 얼마입니까? 답을 가장 가까운 정수로 표현하세요.

[asy]
size(200); import geometry; import olympiad; import graph;
real radius = 64.0;
real center = 0.0;
for(int i = 0; i < 20; ++i){

radius = radius / 2.0;

center = center + radius;

draw(Circle((center,0.0),radius));

center += radius;
}
[/asy]

만약 \[f(x) =
\begin{cases}
2x-5 &\quad \text{if } x \ge 3, \\
-x + 5 &\quad \text{if } x < 3,
\end{cases}
\]일 때, $f(f(x)) = 3$인 $x$의 값은 몇 개인가?

정수 $n$에 대해 \[f(n) = \left\{
\begin{array}{cl}
n^2 & \text{ $n$이 홀수인 경우}, \\
n^2 - 4n - 1 & \text{ $n$이 짝수인 경우}.
\end{array}
\right.\]일 때, $f(f(f(f(f(4)))))$의 값을 구하시오.

복소수 $z$에 대해, \[f(z) = \left\{
\begin{array}{cl}
z^{2}&\text{ if }z\text{ 이 실수가 아닌 경우}, \\
z+2 &\text{ if }z\text{ 이 실수인 경우}.
\end{array}
\right.\]일 때, $f(i)+f(1)+f(-1)+f(-i)$의 값을 구하시오.

Let \[f(n) = \left\{
\begin{array}{cl}
\lfloor n \rfloor & \text{ if }n \geq 4, \\
\lceil n \rceil & \text{ if } n < 4.
\end{array}
\right.\] $f\left(\frac{\pi}{3}\right) + f(\sqrt{45}) + f(8^{2/3})$의 값을 구하세요.

함수 \[ f(x) =
\begin{cases}
ax^2 & \text{if } x \geq a,\\
ax +2a& \text{if } x <a,
\end{cases}
\]가 주어질 때, $y=f(x)$의 그래프가 모든 수평선을 적어도 한 번씩 교차하게 하는 가장 큰 $a$의 값은 무엇인가?

$f(x)$의 그래프가 아래에 주어진 것처럼 $1 \le x \le 6$에서 정의될 때, $f^{-1}(x)$의 최대값은 얼마입니까? [asy]

import graph; size(7.94cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.96,xmax=8.96,ymin=-2.66,ymax=4.38;

Label laxis; laxis.p=fontsize(10);

xaxis("$x$",-0.96,8.96,Ticks(laxis,Step=1.0,Size=2,OmitTick(0)),Arrows(6),above=true); yaxis("$y$",-2.66,4.38,Ticks(laxis,Step=1.0,Size=2,OmitTick(0)),Arrows(6),above=true); draw((1,2)--(3,0),linewidth(1.2)); draw((3,3)--(5,2),linewidth(1.2)); draw((5,-2)--(6,0),linewidth(1.2)); filldraw(circle((5,-2),0.08),white); label("$ f(x) $",(0.5,4.3),SE*lsf);

dot((3,0),UnFill(0)); dot((1,2)); dot((3,3)); dot((5,2),ds); dot((6,0));

clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy]

아래의 다트판의 반지름은 6인치입니다. 각각의 동심원은 다음 큰 원보다 반지름이 2인치 작습니다. 만약 아홉 개의 다트가 표적에 무작위로 꽂힌다면, 음영 처리가 안된 부분에 몇 개의 다트가 꽂힐 것으로 예상하십니까?

[asy]import graph;
fill(Circle((0,0),15),gray(0.7));
fill(Circle((0,0),10),white);
draw(Circle((0,0),20));
draw(Circle((0,0),15));
draw(Circle((0,0),10));
[/asy]

세 개의 서로 다른 한 자리 양의 정수가 하단 행의 셀에 배치됩니다. 인접한 셀의 숫자가 더해지고 그 합이 그 위에 있는 셀에 놓입니다. 두 번째 행에서도 같은 과정을 계속하여 상단 셀에 숫자를 구합니다. 상단 셀에서 가능한 최대 숫자와 최소 숫자의 차이는 얼마입니까? [asy]
path box=(0,0)--(1,0)--(1,1)--(0,1)--cycle;
draw(box);
draw(shift(1.5,0)*box);
draw(shift(3,0)*box);
draw(shift(.75,2)*box);
draw(shift(2.25,2)*box);
draw(shift(1.5,4)*box);
picture p;
draw(p, (.6,.2)--(.95, .8), EndArrow);
draw(p, (1.9,.2)--(1.55, .8), EndArrow);
draw(p, (1.25, .8)--(1.25,.6));
draw(p, (1.15, .7)--(1.35,.7));
add(shift(0,1)*p);
add(shift(1.5,1)*p);
add(shift(.75,3)*p);
[/asy]

오각형 $ABCDE$에 두 개의 정삼각형을 다섯 위치 중 두 곳에 붙여 만들 수 있는 도형은 몇 개인가?

[asy]
pair A,B,C,D,I;
A=(10,0);
B=(0,0);
C=(-3.1,9.5);
D=(5,15.4);
I=(13.1,9.5);
draw(A--B--C--D--I--cycle,linewidth(0.7));
draw(A--B--(5,-8.7)--cycle,dashed);
draw(A--I--(19.8,2.1)--cycle,dashed);
draw(C--B--(-9.8,2.1)--cycle,dashed);
draw(I--D--(14.15,19.4)--cycle,dashed);
draw(D--C--(-4.15,19.4)--cycle,dashed);
label("$A$",A,SE);
label("$B$",B,SW);
label("$C$",C,W);
