중심이 $R$인 원의 반지름이 다음 조건을 만족하면서 감소합니다:

$\bullet$ 중심이 $R$인 원이 여전히 $BC$에 접하고,

$\bullet$ 중심이 $R$인 원이 여전히 다른 세 원에 접하고,

$\bullet$ 중심이 $P$인 원이 다른 세 원에 접하게 됩니다.

다른 세 원의 반지름과 접점은 동일하게 유지됩니다. 이로 인해 $\triangle ABC$의 크기와 모양이 변합니다. $r$은 중심이 $R$인 원의 새로운 반지름입니다. $r$은 $\frac{a+\sqrt{b}}{c}$ 꼴입니다. $a+b+c$를 구하세요.

직사각형 $ABCD$에서 $AB = 16$이고, $P$는 $\angle APD=90^{\circ}$를 만족하는 $BC$ 상의 점이다. $TS$는 $BC$에 수직이고 $BP=PT$인 것처럼 보인다. $PD$는 $TS$와 $Q$에서 만난다. 점 $R$은 $CD$ 위에 있고 $RA$는 $Q$를 지난다. $\triangle PQA$에서 $PA=20$, $AQ=25$, $QP=15$이다. $QR - RD$를 구하시오.

[asy]
size(7cm);defaultpen(fontsize(9));
real sd = 7/9 * 12;
path extend(pair a, pair b) {return a--(10 * (b - a));}

// Rectangle
pair a = (0, 0); pair b = (0, 16); pair d = (24 + sd, 0); pair c = (d.x, b.y);
draw(a--b--c--d--cycle);
label("$A$", a, SW);label("$B$", b, NW);label("$C$", c, NE);label("$D$", d, SE);

// Extra points and lines
pair q = (24, 7); pair s = (q.x, 0); pair t = (q.x, b.y);
pair r = IP(c--d, extend(a, q));
pair p = (12, b.y);
draw(q--a--p--d--r--cycle);draw(t--s);
label("$R$", r, E); label("$P$", p, N);label("$Q$", q, 1.2 * NE + 0.2 * N);label("$S$", s, S); label("$T$", t, N);

// Right angles and tick marks
markscalefactor = 0.1;
draw(rightanglemark(a, b, p)); draw(rightanglemark(p, t, s)); draw(rightanglemark(q, s, d));draw(rightanglemark(a, p, q));
add(pathticks(b--p, 2, spacing=3.4, s=10));add(pathticks(p--t, 2, spacing=3.5, s=10));

// Number labels
label("$16$", midpoint(a--b), W); label("$20$", midpoint(a--p), NW); label("$15$", midpoint(p--q), NE);
label("$25$", midpoint(a--q), 0.8 * S + E);
[/asy] Find $QR - RD$.

도형에서 점 $X$, $Y$, $Z$는 삼각형 $\triangle UVW$의 변 위에 있습니다. 선분 $UY$, $VZ$, $WX$는 $P$에서 만납니다. 점 $Y$는 $VW$ 위에 있으며 $VY:YW=4:3$입니다. 만약 $\triangle PYW$의 넓이가 30이고 $\triangle PZW$의 넓이가 35라면, $\triangle UXP$의 넓이를 구하시오. [asy]
