label("\(B\)",B,dir(180));
label("\(C\)",C,dir(0));
label("\(D\)",D,dir(0));
label("\(E\)",E,dir(0));
[/asy]

$\triangle ABC$의 넓이는 6제곱 센티미터입니다. $\overline{AB}\|\overline{DE}$. $BD=4BC$. $\triangle CDE$의 넓이는 몇 제곱 센티미터입니까? [asy]
