이등변 직각삼각형 $ABC$는 넓이가 $2\pi$인 반원을 둘러싸고 있습니다. 원의 중심 $O$는 빗변 $\overline{AB}$ 위에 있고, 변 $\overline{AC}$와 $\overline{BC}$에 접해 있습니다. 삼각형 $ABC$의 넓이는 얼마입니까? [asy]
