세 개의 합동 이등변 삼각형 $DAO$, $AOB$ 및 $OBC$는 $AD=AO=OB=BC=10$이며 $AB=DO=OC=12$입니다. 이 삼각형들은 사다리꼴 $ABCD$를 형성하도록 배열됩니다. 점 $P$는 $OP$가 $AB$에 수직이 되도록 변 $AB$ 위에 있습니다.

