사다리꼴 $ABCD$의 넓이는 얼마입니까?

지구의 적도 길이가 정확히 25,100마일이고 지구가 완벽한 구체라고 가정합니다. 위스콘신 주 레나 마을은 북위 $45^{\circ}$에 있으며 적도와 북극 사이의 정확히 중간 지점에 있습니다. 레나, 위스콘신을 통해 적도에 평행한 지구상의 원의 둘레는 몇 마일입니까? 답변을 가장 가까운 백의 자리로 표현하십시오. (이 문제에 대해 계산기를 사용할 수 있습니다.)

[asy]
size(4.5cm,4.5cm);
draw(unitcircle);
draw((-1,0)..(0,-0.2)..(1,0));
draw((-0.95,0.05)..(0,0.2)..(0.97,0.05),1pt+dotted);
draw((-0.7,0.7)..(0,0.6)..(0.7,0.7));
draw((-0.65,0.75)..(0,0.8)..(0.66,0.75),1pt+dotted);
dot((0,0));
draw((0,0)--(1,0));
draw((0,0)--(0.7,0.7));
dot((0.7,0.7));
dot((0,0.72));
label("Lena",(0.7,0.7),ENE);
label("$45^\circ$",shift(0.3,0.1)*(0,0));
[/asy]

단위원이 $(5,0)$에 중심을 두고 있으며, 반지름이 $2$인 두 번째 원은 중심이 $(11,0)$에 있습니다. 두 원의 공통 내부 접선은 $x$축과 $Q(a,0)$에서 교차합니다. $a$의 값은 얼마입니까? [asy]
