아래 도형에서, 밑변 $\overline{AB}$을 가진 이등변삼각형 $\triangle ABC$의 높이는 $CH = 24$ cm입니다. $DE = GF$, $HF = 12$ cm, $FB = 6$ cm일 때, 오각형 $CDEFG$의 넓이는 몇 제곱센티미터입니까? [asy]
