원의 위에 있는 점 $A,$ $B,$ $C,$ $D$가 있습니다.  각 점 쌍마다, 그 두 점의 중점을 지나는 선을 그리고, 다른 두 점에 의해 형성된 선에 수직이 되도록 그립니다. 예를 들어, 우리는 $\overline{AB}$의 중점을 지나는 선을 그리고, 이 선은 $CD$와 수직입니다. 이렇게 하면 총 $\binom{4}{2} = 6$ 개의 선을 그리게 됩니다.

[asy]
unitsize(2.5 cm);

pair A, B, C, D, P;
pair[] M;

A = dir(118);
B = dir(62);
C = dir(323);
D = dir(165);
M[12] = (A + B)/2;
M[13] = (A + C)/2;
M[14] = (A + D)/2;
M[23] = (B + C)/2;
M[24] = (B + D)/2;
M[34] = (C + D)/2;
P = (A + B + C + D)/2;

draw(Circle((0,0),1),red);
draw(A--B,green);
draw(A--C,green);
draw(A--D,green);
draw(B--C,green);
draw(B--D,green);
draw(C--D,green);
draw(interp(M[12],P,-2)--interp(M[12],P,6),dashed);
draw(interp(M[13],P,-2)--interp(M[13],P,2),dashed);
draw(interp(M[14],P,-0.5)--interp(M[14],P,2.5),dashed);
draw(interp(M[23],P,-0.7)--interp(M[23],P,1.5),dashed);
draw(interp(M[24],P,-3.3)--interp(M[24],P,4),dashed);
draw(interp(M[34],P,-0.3)--interp(M[34],P,1.6),dashed);

dot("$A$", A, A);
dot("$B$", B, B);
dot("$C$", C, C);
dot("$D$", D, D);
dot(M[12]);
dot(M[13]);
dot(M[14]);
dot(M[23]);
dot(M[24]);
dot(M[34]);
[/asy]

결국 모든 여섯 개의 선은 항상 동일한 점 $P$를 지나가게 됩니다. 상수 $a,$ $b,$ $c,$ $d$가 존재하여 $\overrightarrow{P}$는 항상 다음과 같은 형태로 표현될 수 있습니다.
\[\overrightarrow{P} = a \overrightarrow{A} + b \overrightarrow{B} + c \overrightarrow{C} + d \overrightarrow{D}.\] $a + b + c + d$를 구하십시오.

도형에서 $\cos V = \frac{2}{3}$일 때, $TV$의 길이는 얼마입니까?

