세 개의 단위원이 아래와 같이 서로 접하도록 그려져 있습니다. 세 개의 단위원 모두와 외접하는 파란색 원이 그려집니다. 마지막으로, 세 개의 빨간색 원이 그려지는데, 각 빨간색 원은 두 개의 단위원과 외접하며 파란색 원과 외접합니다. 그런 다음, 각 빨간색 원의 반지름은 다음과 같은 형태로 표현될 수 있습니다
\[\frac{a - b \sqrt{c}}{d},\]여기서 $a,$ $b,$ $c,$ 및 $d$ 는 양의 정수입니다. $a + b + c + d$를 구하십시오.

[asy]
unitsize(2 cm);

pair A, B, C, D, E, F, O;
real s = 2/sqrt(3) - 1, r = (9 - 4*sqrt(3))/33;

A = 2/sqrt(3)*dir(150);
B = 2/sqrt(3)*dir(30);
C = 2/sqrt(3)*dir(270);
O = (0,0);
D = (r + s)*dir(330);
E = (r + s)*dir(210);
F = (r + s)*dir(90);

filldraw(Circle(O,s),blue);
filldraw(Circle(D,r),red);
filldraw(Circle(E,r),red);
filldraw(Circle(F,r),red);
draw(Circle(A,1));
draw(Circle(B,1));
draw(Circle(C,1));
[/asy]

어떤 양의 상수 $a,$ $b,$ $c$에 대해 $y = a \sin (bx + c)$의 그래프가 아래에 있습니다. $b$를 구하세요. 

