$ABCD$가 볼록 사각형이고, $M$과 $N$이 각각 $\overline{AC}$와 $\overline{BD}$의 중점이라고 하자. 그러면 어떤 상수 $k$가 존재하여
\[AB^2 + BC^2 + CD^2 + DA^2 = AC^2 + BD^2 + k \cdot MN^2.\] 이 식이 성립한다. $k$를 구하라.

