파라메트릭 곡선 $(x,y) = (\sin t, \sin 2t)$이 아래에 그려져 있습니다.

[asy]
unitsize(2 cm);

pair moo (real t) {
  return (sin(t),sin(2*t));
}

real t;
path foo = moo(0);

for (t = 0; t <= 2*pi + 0.1; t = t + 0.1) {
  foo = foo--moo(t);
}

draw((-1.2,0)--(1.2,0));
draw((0,-1.2)--(0,1.2));
draw(foo,red);
[/asy]

이 곡선은 또한 다음 형태로 표현될 수 있습니다.
\[ax^4 - bx^2 + cy^2 = 0,\]여기서 $a,$ $b,$ 그리고 $c$는 양의 정수입니다.  $a + b + c$의 가능한 가장 작은 값을 찾으세요.

